INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES ("青空の下で謁見", 10118, 8, "フリーマーケット会場", 5118061, 7, 2, 1, "ペコリーヌとの出会い", 91002, 0, 20063115, 40, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 2834);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES ("未来の騎空団\nマスコット？", 10118, 8, "フリーマーケット会場", 5118062, 7, 2, 1, "マホとの出会い", 91002, 0, 20063115, 40, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 2835);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES ("お嬢さまからの\n緊急依頼", 10118, 8, "ランドソル市街地", 5118063, 7, 2, 1, "アキノとの出会い", 91002, 0, 20063115, 40, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 2837);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES ("黄金色の悩みごと", 10118, 8, "フリーマーケット会場", 5118064, 18, 2, 1, "ジュンとの出会い", 91002, 0, 20063115, 40, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 4108402);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES ("白熱！　格闘大会！", 10118, 8, "フリーマーケット会場", 5118065, 18, 2, 1, "カオリとの出会い", 91002, 0, 20063115, 40, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 4107402);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES ("祭り太鼓はオーエドの華", 10118, 8, "オーエド町", 5118066, 16, 2, 1, "ニノンとの出会い", 91002, 1, 20063115, 40, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 9000227);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES ("人気者は遅れて\nやってくる", 10118, 8, "フリーマーケット会場", 5118067, 19, 3, 1, "スズナとの出会い", 91002, 0, 20063115, 40, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 2101181);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES ("巫女・ミーツ・魔法少女", 10118, 8, "ランドソル市街地", 5118068, 18, 3, 1, "ナナカとの出会い", 91002, 0, 20063115, 40, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 4109402);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES ("ネズ耳は二度なくなる", 10118, 8, "フリーマーケット会場", 5118069, 18, 3, 1, "キャル＆コッコロとの出会い", 91002, 0, 20063115, 40, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 4305402);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES ("この出会いにカンパイ！", 10118, 8, "ランドソル市街地", 5118070, 18, 3, 1, "ユカリとの出会い", 91002, 0, 20063115, 40, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 4101402);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES ("陰陽アンサンブル", 10118, 8, "ランドソル市街地", 5118071, 18, 3, 1, "アオイとの出会い", 91002, 0, 20063115, 40, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 4106402);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES ("運試し十番勝負！", 10118, 8, "フリーマーケット会場", 5118072, 7, 3, 1, "シノブとの出会い", 91002, 1, 20063115, 40, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 2836);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES ("彼女たちの新たな日常", 10118, 0, 0, 5118600, 0, 1, 0, "オープニング", 0, 0, 20063115, 0, 0, 0);
